import React from 'react';
import { Admin, Resource } from 'react-admin';
import restProvider from 'ra-data-simple-rest';
import {PostList, PostEdit, PostCreate} from './components/post/post';
import './App.css';

function App() {
  return (
    <Admin dataProvider={restProvider('http://localhost:5000')}>
        <Resource name="key" list={PostList} edit={PostEdit} create={PostCreate}  />
    </Admin>
  );
}

export default App;
